import React from 'react';
import s from "./Dialogs.module.css";
import { NavLink } from 'react-router-dom';


const DialogItem = (props) => {
    return (
        <div className={s.dialog}>
            <NavLink to={"/dialogs/" + props.id}>
                {props.name}
            </NavLink>
        </div>
    );
}

const Message = (props) => {
    return (
        <div className={s.message}>{props.message}</div>
    );
}



const Dialogs = (props) => {

    let dialogs = [
    { id: 1, name: 'Alex' },
    { id: 2, name: 'Matvey' },
    { id: 3, name: 'Victor' },
    { id: 3, name: 'Sasha' },
    { id: 5, name: 'Artem' },
    { id: 6, name: 'Pasha' }
    ]

    let messeges = [
        { id: 1, message: 'Hi' },
        { id: 2, message: 'Hello' },
        { id: 3, message: 'you' },
        { id: 3, message: 'Yo' },
        { id: 5, message: 'Good bay' },
        { id: 6, message: 'Lose' }
        ]

    let dialogsElements = dialogs.map( d => <DialogItem name={d.name} id={dialog.id}/>);

    let messegesElements = messeges.map( m => <Message message={m.message}/>);

    return (
        <div className={s.dialogs}>
            <div className={s.dialogs_items}>
                {dialogsElements}
                 </div>
            <div className={s.messages}>
                {messegesElements}
            </div>
        </div>
    );
}

export default Dialogs;
